import React, { Component } from 'react';
import { render } from 'react-dom';
import Map from './Map';
import './style.css';

const data = [{
  lat: 12.940969,
  lon: 100.88685699999999
},];
render(<Map center={{ lat: 13.36, lng: 100.98 }} zoom={10} positions={data} />, document.getElementById('root'));
